import React from "react";
import { AiOutlineMenu } from "react-icons/ai";

const Navbar = () => {
  return (
    <div>
      {" "}
      <div className="container flex  max-w-full items-center justify-between border-y-0 border-s-slate-500 bg-slate-700 p-5 shadow-md sm:max-w-full lg:px-24 lg:py-6">
        <h1 className="font-bold text-green-400 sm:text-[1rem] lg:text-3xl">REACT APP</h1>
        <ul className=" hidden font-sans text-[0.95rem] font-bold text-slate-300 lg:flex">
          <li className="px-2">Home</li>
          <li className="px-2">About</li>
          <li className="px-2">Porfolio</li>
          <li className="px-2">Source</li>
          <li className="px-2">Project</li>
        </ul>
      </div>
      <div className="hidden  bg-slate-100 text-slate-300 md:flex">
        <AiOutlineMenu size={20}></AiOutlineMenu>
      </div>
    </div>
  );
};

export default Navbar;
